import { Link } from "react-router-dom";

const Card = ({name, image, type}) => {
    console.log(name)
    return(
        <Link >
            <button className={style.container}>
                <img src={image} alt='F'/>
                <h3>{name}</h3>
                <p>{type}</p>
            </button>
        </Link>

    )
}

export default Card;
